    <style>@charset "utf-8";html{box-sizing:border-box;-webkit-box-sizing:border-box;-moz-box-sizing:border-box;-ms-box-sizing:border-box;-o-box-sizing:border-box;-ms-text-size-adjust:100%;-webkit-text-size-adjust:100%;scroll-behavior:smooth;height:100%}*,*::before,*::after{box-sizing:border-box;-webkit-box-sizing:border-box;-moz-box-sizing:border-box;-ms-box-sizing:border-box;-o-box-sizing:border-box;-webkit-font-smoothing:antialiased;-moz-osx-font-smoothing:grayscale;position:relative}body{min-height:100vh;scroll-behavior:smooth;text-rendering:optimizeSpeed;line-height:1.5;height:100%;font-display:swap}body,h1,h2,h3,h4,h5,h6,ul,ol,li,p,pre,blockquote,figure,figcaption,hr,dl,dd{margin:0;padding:0}ul{list-style:none}a{text-decoration:none}input,textarea,select,button{color:inherit;font:inherit;letter-spacing:inherit;padding:0;}*,button:active,button:visited,button:focus{outline:none;border:none}input[type="text"],textarea{width:100%}input,textarea,button{border:0}input[type="text"],input[type="email"],input[type="password"],textarea{-webkit-appearance:none}button{line-height:inherit;border-radius:0;background-color:transparent;cursor:pointer}img,iframe,video,object,embed{display:block;max-width:100%}svg{max-width:100%;}table{table-layout:fixed;width:100%}[hidden]{opacity:0;visibility:hidden}noscript{display:block;margin-bottom:1em;margin-top:1em}[tabindex="-1"]{outline:none!important}@media(prefers-reduced-motion:reduce){*{animation-duration:0.01ms!important;animation-iteration-count:1!important;transition-duration:0.01ms!important;scroll-behavior:auto!important}}.sr-only{position:absolute;width:1px;height:auto;margin:0;padding:0;border:0;clip:rect(0 0 0 0);overflow:hidden;white-space:nowrap}.clearfix::after{content:" ";display:block;clear:both}.clearfix{display:flow-root}:root{color-scheme:light dark; --selColor:#777; --cPrimary:#000;--cPrimaryLight:rgba(0,0,0,0.1);--cSecondary:#fff;--cSecondaryLight:rgba(255,255,255,0.1);--cBorder:rgba(0,0,0,0.1);--cAccent:#f2f2f2;--cText:rgba(0,0,0,0.7);--font--xs:10px;--font--s:12px;--font--m:15px;--font--l:40px;--spacing:25px;--fontFamily:"Inter",sans-serif}html{font-size:calc(14px + 0.25vw);}
        body{font-family:var(--fontFamily);background-color:var(--cSecondary);color:var(--cPrimary);font-size: var(--font--m);}.flex{display:flex;justify-content: center;}.flex__c{display:flex; justify-content:center; align-items:center;}.flex__sb{display: flex; justify-content:space-between;}.flex__sa{display: flex; justify-content:space-around;}
        .wrapper{height:100%;display:grid; grid-template-column:1fr; grid-template-rows: 80px 1fr 80px;}
        header{background-color:var(--cSecondary); padding-left:var(--spacing);width:100%;border-bottom:1px solid var(--cBorder);}.logo{color:var(--cPrimary); font-size: var(--font--s);}.logo__header{flex-grow:1;padding-right:var(--spacing);align-items: center;}.header__btn{width:16px;height:36px;padding:0;cursor: pointer;} .header__btn svg{width:100%; height:100%}.btn{font-size:var(--font--s);height:36px;padding:0 12px;border-radius:3px;}.share{background-color:var(--cSecondary); border:1px solid var(--cBorder); color:var(--cPrimary)}header .flex__c {gap:15px;}.dwnload{background-color:var(--cPrimary);color:var(--cSecondary)}.top{}.top p{max-width:700px;margin-bottom:60px;color:var(--cText);font-weight:400;font-size:18px;}.top h1{margin-bottom:20px; font-weight:700;color:var(--cPrimary);font-size:var(--font--l);letter-spacing:-0.83px;}.search{}.search__input{width:100%;border:1px solid var(--cBorder);height:60px;font-size:var(--font--m);padding:0 15px 0 50px;color:var(--cPrimary)}
        .search svg{position:absolute; width:1rem;left:15px;top:23px;z-index:2;}.socialShare{border-left:1px solid var(--cBorder);width:300px;font-size:var(--font--m);} .socialShare__item{height:16px;vertical-align:middle;margin-right:10px;}.fill__w{fill: var(--cPrimary);}.socialShare a{padding:0; display: inline-flex; flex: 1 1 100%; justify-content: center; align-items: center;}.type{margin:0 auto; max-width:480px;}
        .icons{width:100%;margin:0 auto;margin-top:-1px;}.collection{width:100%;}
        .collection__list{display:grid;grid-template-columns:repeat(10,1fr);grid-auto-rows:auto;grid-auto-columns:auto;grid-gap:0;width:100%;} footer {padding-left:var(--spacing);color:var(--cText);font-size: var(--font--m);border-top:1px solid var(--cBorder);}footer a{color:var(--cPrimary);}footer > div{height:100%;}.small{font-size: var(--font--s);}
        .sidebar__header{width:300px;border-left:1px solid var(--cBorder);padding:0 var(--spacing);align-items: center;}.sidebar{width:300px;overflow-x:hidden;padding:var(--spacing);flex-direction:column;display:flex;border-left:1px solid var(--cBorder)}.content{padding:60px 100px;flex-grow:1;overflow-y:scroll;}.main{overflow: scroll;}.grid{display:grid;grid-template-columns:1fr 1fr;}.type__nav{border:1px solid var(--cBorder);border-left:0;}.sidebar__header p { color:var(--cPrimary);}
        .sidebar__content{display:flex; flex-direction:column; justify-content: space-between;height:100%;}.btn{background-color:var(--cPrimary);width:100%;height:60px;font-size: var(--font--m);color:var(--cSecondary); border-radius:0;}.btn--border{border:1px solid var(--cPrimary); width:100%; height:60px;font-size:var(--font--m);}

        .cont{ }.mgt{margin-top:20px;}.mgt li{margin-bottom:5px; color:var(--cText);}
